import axios from 'axios'
const API_KEY = 'bd84d98d30841d5669d443eac854e864'

export const getForecast = async (id) => {
  return await axios.get(`http://api.openweathermap.org/data/2.5/forecast?id=524901&appid={${API_KEY}}`).then(res => {
    return res
  })
}
